export default (function(a,b,c,d,e){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:d,pageSize:25,pageCount:d,total:5}}},"99U2o6DiGI":{data:{id:155,attributes:{imdbId:"tt0808151",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjEzNzM2MjgxMF5BMl5BanBnXkFtZTcwNTQ1MTM0Mg@@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"},{Source:"Rotten Tomatoes",Value:"37%"},{Source:"Metacritic",Value:"48\u002F100"}],item_lang:{data:{id:818,attributes:{title:e,plot:"Following the murder of a physicist, Father Silvano Bentivoglio, a symbolist, Robert Langdon, and a scientist, Vittoria Vetra, are on an adventure involving a secret brotherhood, the Illuminati. Clues lead them all around the Vatican, including the four altars of science, Earth, Air, Fire and Water. An assassin, working for the Illuminati, has captured four cardinals, and murders each, painfully. Robert and Vittoria also are searching for a new very destructive weapon that could kill millions.",slug:"angels-and-demons"}}},books:{data:[{id:2376,attributes:{title:"Angels",description:"The well-known evangelist explains the characteristics of angels as well as their purposes and significance in the contemporary world",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sDUbiV92-mIC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Billy Graham"],firstBook:true,published:"1995-01-01",publisher:"Thomas Nelson Inc",subtitle:""}},{id:2377,attributes:{title:"The Truth about Angels",description:"Christians and non-Christians alike are encountering angelic beings more than ever, but what does Scripture say about the appearance of angels? In this revision of his eye-opening book, Terry Law presents fascinating biblical truths about both God's angels and evil angels, while exposing false and dangerous teachings that use New Age techniques to contact these powerful beings. Exploring many real-life stories of experiences with angels, Law believes there is an increase in angelic activity because the world is on the brink of the greatest revival and the most cataclysmic events in the history of mankind. The Truth About Angels will answer: - What are angels, and where did they come from? - Are angels appearing more frequently around the world? - Do you have a guardian angel? - Are angels involved in healings or the working of miracles? - How do angels and the Holy Spirit work together?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7RQH4Sr9dA0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Terry Law"],firstBook:b,published:"2006-01-01",publisher:"Charisma Media",subtitle:"Angelic Encounters from a Biblical Perspective"}},{id:2378,attributes:{title:"A Book of Angels",description:"A BOOK OF ANGELS tells not only the extraordinary true stories of present-day encounters with angels, but also traces the understanding and study of angels through history and in different cultures. Discover what angels look like, whom they chose to visit, how they enter our lives, and so much more.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gh2c10mNIk0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Sophy Burnham"],firstBook:b,published:"2011-03-31",publisher:"Penguin",subtitle:"Reflections on Angels Past and Present, and True Stories of How They Touch Our L ives"}},{id:2379,attributes:{title:"Angels Are for Real",description:"Angels Have Been, and Will Continue to Be, a Vital Part of God's Kingdom Throughout the ages they have been messengers, protectors, healers, comforters and more to the people of God. Sometimes their presence is as subtle as a whisper of wind, other times as visible as the sun. In this accessible, comprehensive and encouraging guide, Judith MacNutt pulls back the curtain on these intriguing heavenly beings. She offers insight and many stories of miraculous encounters, revealing what the Bible says about • what angels look like • what they do • why they are important in believers' lives • the heavenly hierarchy • what fallen angels are • and more When you begin to grasp the importance of angels to God--and your very own life--you will better understand God's power and His extraordinary love for you. \"This is a book that will intrigue you and give you understanding and definition. You will learn the possibilities of experiencing this realm in your own life.\"--Pastors Bill and Beni Johnson, Bethel Church, Redding, California; authors, When Heaven Invades Earth and The Happy Intercessor",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8BTc4b34h8oC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Judith MacNutt"],firstBook:b,published:"2012-02-01",publisher:"Baker Books",subtitle:"Inspiring, True Stories and Biblical Answers"}},{id:2380,attributes:{title:e,description:"The murder of a world-famous physicist raises fears that the Illuminati are operating again after centuries of silence, and religion professor Robert Langdon is called in to assist with the case.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yTm_C8TWpkcC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Dan Brown"],firstBook:b,published:"2006-05-23",publisher:"Simon and Schuster",subtitle:"A Novel"}}]}}},meta:{}}},prerenderedAt:1681703456233}}("movie",null,"series",1,"Angels & Demons"))